schemas:
DEFINE TABLE IF NOT EXISTS notes SCHEMAFULL;

DEFINE FIELD IF NOT EXISTS id ON notes TYPE UUID;
DEFINE FIELD IF NOT EXISTS title ON notes TYPE string;
DEFINE FIELD IF NOT EXISTS content ON notes TYPE string;
DEFINE FIELD IF NOT EXISTS color ON notes TYPE string;
DEFINE FIELD IF NOT EXISTS created_at ON notes VALUE type::datetime($value);
DEFINE FIELD IF NOT EXISTS updated_at ON notes VALUE type::datetime($value);

DEFINE FIELD IF NOT EXISTS user_id on notes TYPE Record<users>;
DEFINE FIELD IF NOT EXISTS propertys on notes TYPE array<Record<propertys>>;

DEFINE TABLE IF NOT EXISTS propertys SCHEMAFULL;

DEFINE FIELD IF NOT EXISTS id ON propertys TYPE UUID;
DEFINE FIELD IF NOT EXISTS name ON propertys TYPE string;
DEFINE FIELD IF NOT EXISTS color ON propertys TYPE number;
DEFINE FIELD IF NOT EXISTS value ON propertys TYPE number;
DEFINE FIELD IF NOT EXISTS type ON propertys TYPE "Category" | "Priority";
DEFINE FIELD IF NOT EXISTS created_at ON TABLE propertys VALUE type::datetime($value);
DEFINE FIELD IF NOT EXISTS updated_at ON TABLE propertys VALUE type::datetime($value);

DEFINE FIELD IF NOT EXISTS user_id on propertys TYPE Record<users>;

DEFINE TABLE OVERWRITE script_migration SCHEMAFULL
    PERMISSIONS
        FOR select FULL
        FOR create, update, delete NONE;

DEFINE FIELD OVERWRITE script_name ON script_migration TYPE string;
DEFINE FIELD OVERWRITE executed_at ON script_migration TYPE datetime VALUE time::now() READONLY;
DEFINE FIELD OVERWRITE checksum ON script_migration TYPE option<string>;


DEFINE TABLE IF NOT EXISTS users SCHEMAFULL;

DEFINE FIELD IF NOT EXISTS id ON users TYPE UUID;
DEFINE FIELD IF NOT EXISTS name ON users TYPE string;
DEFINE FIELD IF NOT EXISTS email ON users TYPE string;
DEFINE FIELD IF NOT EXISTS password ON users TYPE string;
DEFINE FIELD IF NOT EXISTS bio ON users TYPE string;
DEFINE FIELD IF NOT EXISTS photo_url ON users TYPE string;
DEFINE FIELD IF NOT EXISTS created_at ON TABLE users VALUE type::datetime($value);
DEFINE FIELD IF NOT EXISTS updated_at ON TABLE users VALUE type::datetime($value);
